import axios from '../conexion';

function Encabezado (props){
    var config = {
        method: 'get',
        url: 'http://localhost:3200/api/operation/Ingreso/'+ props.id,
        headers: { 
          'Content-Type': 'application/x-www-form-urlencoded'
        },
    }

    var datos = axios(config).datos; 
    return(
        <div className="Principal">
            <h1>Presupuesto Personal</h1>
            <h2>Su saldo {datos}</h2>
        </div>
    )
}

export default Encabezado;
